script: |
  super -f text -I q6265.spq | sort > q6265.out

inputs:
  - name: q6265.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT ( ( NULL NOT IN ( + col1 / + col1 + col1 ) AND NULL IN ( col2 * col1 * + col1 ) ) AND NOT NULL BETWEEN NULL AND col0 ) AND NOT col0 + col2 * + col1 + col1 BETWEEN NULL AND col2 * col2;
  - name: tab1

outputs:
  - name: q6265.out
    data: |
